import Die from "./components/Die"

export default function App(){

    function allNewDice(){
        const newDice = []
        for (let i = 0; i < 10; i++){
           newDice.push(Math.ceil(Math.random() * 7)) 
        }
        return newDice
    }
    
    const [dice, setDice] = React.useState(allNewDice)

  const diceElement = dice.map(die => <Die value={die}/>)

     return (
     <main>
        <div className="die--block">
            {diceElement}
        </div>
    </main>
     )}
